equal 'resetGameBestTimes'.\n  Expected $[1] = undefined to equal 'test'.\n    at <"+"Jasmine>\n    at UserContext.apply (src/app/services/game-socket.service.spec.ts:463:25)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at runInTestZone (node_modules/zone.js/fesm2015/zone-testing.js:582:34)\n    at UserContext.<"+"anonymous> (node_modules/zone.js/fesm2015/zone-testing.js:597:20)\n    at <"+"Jasmine>\n    at _ZoneDelegate.invokeTask (node_modules/zone.js/fesm2015/zone.js:406:31)\n    at Zone.runTask (node_modules/zone.js/fesm2015/zone.js:178:47)\n    at drainMicroTaskQueue (node_modules/zone.js/fesm2015/zone.js:585:35)","status":"Killed","static":false,"testsCompleted":1,"killedBy":["272"],"coveredBy":["272"],"location":{"end":{"column":22,"line":437},"start":{"column":13,"line":437}}},{"id":"1272","mutatorName":"StringLiteral","replacement":"\"\"","statusReason":"Expected spy send to have been called with:\n  [ 'resetGameBestTimes', 'test' ]\nbut actual calls were:\n  [ '', 'test' ].\n\nCall 0:\n  Expected $[0] = '' to equal 'resetGameBestTimes'.\nError: Expected spy send to have been called with:\n  [ 'resetGameBestTimes', 'test' ]\nbut actual calls were:\n  [ '', 'test' ].\nCall 0:\n  Expected $[0] = '' to equal 'resetGameBestTimes'.\n    at <"+"Jasmine>\n    at UserContext.apply (src/app/services/game-socket.service.spec.ts:463:25)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at runInTestZone (node_modules/zone.js/fesm2015/zone-testing.js:582:34)\n    at UserContext.<"+"anonymous> (node_modules/zone.js/fesm2015/zone-testing.js:597:20)\n    at <"+"Jasmine>\n    at _ZoneDelegate.invokeTask (node_modules/zone.js/fesm2015/zone.js:406:31)\n    at Zone.runTask (node_modules/zone.js/fesm2015/zone.js:178:47)\n    at drainMicroTaskQueue (node_modules/zone.js/fesm2015/zone.js:585:35)","status":"Killed","static":false,"testsCompleted":1,"killedBy":["272"],"coveredBy":["272"],"location":{"end":{"column":68,"line":437},"start":{"column":48,"line":437}}},{"id":"1273","mutatorName":"StringLiteral","replacement":"\"\"","statusReason":"Expected spy send to have been called with:\n  [ 'resetAllBestTimes' ]\nbut actual calls were:\n  [ 'resetGameBestTimes', 'test' ],\n  [ '' ].\n\nCall 0:\n  Expected $.length = 2 to equal 1.\n  Expected $[0] = 'resetGameBestTimes' to equal 'resetAllBestTimes'.\n  Unexpected $[1] = 'test' in array.\nCall 1:\n  Expected $[0] = '' to equal 'resetAllBestTimes'.\nError: Expected spy send to have been called with:\n  [ 'resetAllBestTimes' ]\nbut actual calls were:\n  [ 'resetGameBestTimes', 'test' ],\n  [ '' ].\nCall 0:\n  Expected $.length = 2 to equal 1.\n  Expected $[0] = 'resetGameBestTimes' to equal 'resetAllBestTimes'.\n  Unexpected $[1] = 'test' in array.\nCall 1:\n  Expected $[0] = '' to equal 'resetAllBestTimes'.\n    at <"+"Jasmine>\n    at UserContext.apply (src/app/services/game-socket.service.spec.ts:465:25)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at runInTestZone (node_modules/zone.js/fesm2015/zone-testing.js:582:34)\n    at UserContext.<"+"anonymous> (node_modules/zone.js/fesm2015/zone-testing.js:597:20)\n    at <"+"Jasmine>\n    at _ZoneDelegate.invokeTask (node_modules/zone.js/fesm2015/zone.js:406:31)\n    at Zone.runTask (node_modules/zone.js/fesm2015/zone.js:178:47)\n    at drainMicroTaskQueue (node_modules/zone.js/fesm2015/zone.js:585:35)","status":"Killed","static":false,"testsCompleted":1,"killedBy":["272"],"coveredBy":["272"],"location":{"end":{"column":57,"line":438},"start":{"column":38,"line":438}}}],"source":"/* eslint-disable max-lines */\n// All methods and properties in this file are implicitly related to communication over socket with the server.\n// For readability purposes, we allow this max-line disable to centralize this logically connected information.\n// Furthermore, comments and method descriptions add length to the file. but they improve readability.\nimport { Injectable, OnDestroy } from '@angular/core';\nimport { MatDialog, MatDialogRef } from '@angular/material/dialog';\nimport { Router } from '@angular/router';\nimport { EndgamePopUpComponent } from '@app/components/endgame-pop-up/endgame-pop-up.component';\nimport { JoinRequestPopupComponent } from '@app/components/join-request-popup/join-request-popup.component';\nimport { MessageComponent } from '@app/components/message/message.component';\nimport { WaitingRoomPopupComponent } from '@app/components/waiting-room-popup-component/waiting-room-popup-component.component';\nimport { ChatColor, PlaybackConstants, Time } from '@app/constants/constants';\nimport { Game } from '@common/game';\nimport { GameInstance } from '@common/game-instance';\nimport { Message } from '@common/message';\nimport { Pixel } from '@common/pixel';\nimport { PlayingUser } from '@common/playing-user';\nimport { GameSettings } from '@common/settings';\nimport { BehaviorSubject, Subject } from 'rxjs';\nimport { CommunicationService } from './communication.service';\nimport { GameFeedbackService } from './game-feedback.service';\nimport { SaveReplayService } from './save-replay.service';\nimport { SheetContainerService } from './sheet-container.service';\nimport { SocketClientService } from './socket-client.service';\n\n@Injectable({\n    providedIn: 'root',\n})\nexport class GameSocketService implements OnDestroy {\n    isOngoing: boolean;\n    gameInstance: GameInstance;\n    image1: string;\n    image2: string;\n    username: string;\n    isValidUsername: Subject<"+"boolean>;\n    serverTimer: BehaviorSubject<"+"number>;\n    waitingRoomRef: MatDialogRef<"+"WaitingRoomPopupComponent>;\n    messages: MessageComponent[];\n    settingsValue: BehaviorSubject<"+"GameSettings>;\n    private audio: HTMLAudioElement;\n    private frozenByError: boolean;\n    private currentTime: number;\n    private errorDelay: number;\n\n    // The max-params rule is disabled because the class needs all of these services to work properly.\n    // eslint-disable-next-line max-params\n    constructor(\n        private router: Router, // Needed to redirect user to various pages on server messages\n        public socketService: SocketClientService, // Allows socket communication\n        private communicationService: CommunicationService, // Allows http requests for files and basic game information download\n        private dialog: MatDialog, // Needed to prompt the user for multiplayer games which is dictated by server messages\n        private sheetContainerService: SheetContainerService, // Needed to update sheets best time display\n        public gameFeedbackService: GameFeedbackService, // Needed to call game logic on server message\n        private saveReplay: SaveReplayService, // Needed to save any server message to replicate game on replay\n    ) {\n        this.isOngoing = false;\n        this.isValidUsername = new Subject<"+"boolean>();\n        this.messages = [];\n        this.audio = new Audio();\n        this.frozenByError = false;\n        this.settingsValue = new BehaviorSubject({ initialTime: 30, penaltyTime: 5, bonusTime: 5 });\n        this.serverTimer = new BehaviorSubject<"+"number>(0);\n        this.errorDelay = Time.SecToMs;\n        this.connect();\n\n        this.serverTimer.subscribe((currentTime) => {\n            this.currentTime = currentTime;\n        });\n    }\n\n    ngOnDestroy(): void {\n        this.socketService.disconnect();\n    }\n\n    connect() {\n        if (!this.socketService.isSocketAlive()) {\n            this.socketService.connect();\n            this.configureBaseSocketFeatures();\n        }\n    }\n\n    setErrorDelay(delay: number) {\n        this.errorDelay = Time.SecToMs / delay;\n    }\n\n    configureBaseSocketFeatures() {\n        this.socketService.on('disconnect', () => {\n            this.gameFeedbackService.isCheating = false;\n        });\n        this.socketService.on('initSettings', (settings: GameSettings) => {\n            this.settingsValue.next(settings);\n        });\n        /*\n         * The client receives the game instance from the server and navigates to the game page\n         */\n        this.socketService.on('gameCreated', (game: GameInstance) => {\n            this.isOngoing = true;\n            this.messages = [];\n            this.dialog.closeAll();\n            this.gameInstance = game;\n            this.gameFeedbackService.nbClues = 3;\n            this.errorDelay = Time.SecToMs;\n            this.communicationService.getGameFiles(game.title).subscribe((data) => {\n                this.image1 = data[0];\n                this.image2 = data[1];\n                this.router.navigate(['/game']);\n            });\n        });\n\n        /*\n         * Sets the username validity to true or false depending on the server response\n         * (the server verifies if the username is already taken)\n         */\n        this.socketService.on('usernameValidity', (isValid: boolean) => {\n            this.isValidUsername.next(isValid);\n        });\n\n        /*\n         * Sets the time of the client to the time of the server\n         * (the server sends the time every second)\n         */\n        this.socketService.on('gameTimeUpdated', this.handleGameTimeUpdated);\n\n        /*\n         * The client is refused by the host\n         */\n        this.socketService.on('playerRefused', () => {\n            this.waitingRoomRef.componentInstance.data.prompt = \"L'hte a refus la partie.\";\n        });\n\n        this.socketService.on('kicked', () => {\n            this.dialog\n                .open(WaitingRoomPopupComponent, {\n                    width: '20%',\n                    data: { gameTitle: '', prompt: \"La partie n'existe plus.\" },\n                    disableClose: true,\n                    panelClass: 'container',\n                    autoFocus: false,\n                })\n                .afterClosed()\n                .subscribe(() => {\n                    this.reload();\n                });\n        });\n\n        /*\n         * The host receives the request to join the game and opens a popup to accept or refuse the request\n         */\n        this.socketService.on('playerRequestJoin', (user: PlayingUser) => {\n            this.dialog\n                .open(JoinRequestPopupComponent, { width: '30%', data: user, panelClass: 'container', autoFocus: false })\n                .afterClosed()\n                .subscribe((accepted: boolean) => {\n                    this.socketService.send(accepted ? 'acceptPlayer2' : 'refusePlayer2');\n                });\n        });\n\n        /*\n         * The client receives an error from the server if he clicked on the wrong pixel\n         * and draws the error on the canvas for a second\n         */\n        this.socketService.on('errorClick', this.handleErrorClick);\n\n        /*\n         * The client receives receives that the game is finished and opens a popup to display the winner\n         */\n        this.socketService.on('gameFinished', (data: { prompt: string; details: string }) => {\n            this.gameFeedbackService.isCheating = false;\n            this.isOngoing = false;\n            this.dialog.closeAll();\n            this.dialog.open(EndgamePopUpComponent, {\n                data,\n                width: '30%',\n                panelClass: 'container',\n                disableClose: true,\n                autoFocus: false,\n            });\n        });\n\n        /*\n         * The client receives that the host has left the game and the next client in line becomes the host\n         */\n        this.socketService.on('becameHost', () => {\n            this.waitingRoomRef.componentInstance.data.prompt = \"En attente d'un joueur...\";\n        });\n\n        this.socketService.on('serverMessage', this.handleServerMessage);\n\n        this.socketService.on('chatMessageToRoom', this.handleChatMessageReceived);\n\n        this.socketService.on('newBestTimeMessage', this.handleNewBestTimeMessage);\n\n        this.socketService.on('settingsChanged', (settings: GameSettings) => {\n            this.settingsValue.next(settings);\n        });\n\n        this.socketService.on('updateBestTime', (gameBestTime: Partial<"+"Game>) => {\n            const game = this.sheetContainerService.currentGames.find((g) => g.title === gameBestTime.title);\n            if (game && gameBestTime.bestTimes) game.bestTimes = gameBestTime.bestTimes;\n        });\n\n        this.socketService.on('updateAllBestTimes', (bestTimes: Game['bestTimes']) => {\n            this.sheetContainerService.currentGames.forEach((game) => {\n                game.bestTimes = bestTimes;\n            });\n        });\n\n        this.socketService.on('gameHistoryAdded', async () => {\n            await this.sheetContainerService.getHistory();\n        });\n\n        this.socketService.on('deleteHistory', () => {\n            this.sheetContainerService.currentHistory = [];\n        });\n\n        this.socketService.on('cluePixelPos', (pixels: Pixel[]) => {\n            this.gameFeedbackService.useClue(pixels);\n            this.saveReplay.saveAction(this.currentTime, 'clue', pixels);\n            this.saveReplay.saveAction(\n                Math.floor(this.currentTime + this.gameInstance.hintPenalty * Time.SecToMs),\n                'time',\n                Math.floor(this.currentTime + this.gameInstance.hintPenalty * Time.SecToMs),\n            );\n        });\n    }\n\n    requestClue() {\n        this.socketService.send('useClue');\n    }\n\n    /**\n     * The client sends the pixel he clicked to the server\n     *\n     * @param p the pixel the client clicked\n     * @param currentCtx the canvas context of the current canvas\n     */\n    sendClick(p: Pixel, currentCtx: CanvasRenderingContext2D) {\n        if (!this.frozenByError) {\n            this.gameFeedbackService.currentErrorCtx = currentCtx;\n            this.socketService.send('sendClick', p);\n        }\n    }\n\n    /**\n     * Requests the server to verify if the username is already taken\n     *\n     * @param username the username the client wants to use\n     */\n    validateUsername(username: string) {\n        this.socketService.send('validateUsername', username);\n    }\n\n    /**\n     * Requests the server to create a 1v1 game\n     *\n     * @param player Client's username and game title\n     * @param isHost true if the client is the host, false otherwise\n     */\n    createGameVs(player: PlayingUser, isHost: boolean) {\n        this.username = player.username;\n        this.socketService.send('startGameVs', player);\n        this.waitingRoomRef = this.dialog.open(WaitingRoomPopupComponent, {\n            width: '20%',\n            data: { gameTitle: player.gameTitle, prompt: isHost ? \"En attente d'un joueur...\" : \"En attente de l'hte...\" },\n            disableClose: true,\n            panelClass: 'container',\n            autoFocus: false,\n        });\n        this.waitingRoomRef.afterClosed().subscribe(() => {\n            this.socketService.send('cancelWaitingRoom');\n        });\n    }\n\n    /**\n     * Requests the server to abandon the game when the client leaves the game page\n     */\n    abandonGame() {\n        this.gameFeedbackService.isCheating = false;\n        this.socketService.send('abandonGame');\n    }\n\n    /**\n     * Requests the server to create a solo game\n     *\n     * @param player Client's username and game title\n     */\n    createGameSolo(player: PlayingUser) {\n        this.username = player.username;\n        this.socketService.send('startGameSolo', player);\n    }\n\n    createGameLimitedTime(username: string, buttonText: string) {\n        this.username = username;\n        this.socketService.send('startGameLimitedTime' + buttonText.replace(/^\\w/, (c) => c.toUpperCase()), username);\n    }\n\n    /**\n     * plays the right or wrong answer sound depending on the parameter\n     *\n     * @param isDifferenceFound true if the client clicked on the right pixel, false otherwise\n     */\n    playFeedbackSound(isDifferenceFound: boolean) {\n        this.audio.pause();\n        this.audio.currentTime = 0;\n        this.audio.src = isDifferenceFound ? './assets/right-answer.mp3' : './assets/wrong-answer.mp3';\n        this.audio.play();\n    }\n\n    /**\n     * Requests the server to join the selection room\n     */\n    joinSelectionRoom() {\n        this.socketService.send('joinSelectionRoom');\n    }\n\n    /**\n     * Sends a message to the other player in the room and displays on this client's chat\n     *\n     * @param text the text the client wants to send\n     */\n    handleChatMessageSent(text: string, isReplay?: boolean, message?: MessageComponent) {\n        if (!message) {\n            message = new MessageComponent();\n            message.color = ChatColor.Sent;\n            message.message = { sender: this.username, text };\n            message.date = new Date().toLocaleTimeString('it-IT');\n        }\n        this.messages.unshift(message);\n        this.socketService.send('chatMessage', text);\n        if (!isReplay) this.saveReplay.saveAction(this.currentTime, 'chatMessageSent', message);\n    }\n\n    /**\n     * Handles the reception of a message from another player and displays it on this client's chat\n     *\n     * @param messageReceived the message the other player sent\n     * @param isReplay true if the message is sent during a replay, false otherwise\n     */\n    handleChatMessageReceived = (messageReceived: Message, isReplay?: boolean, message?: MessageComponent) => {\n        if (!message) {\n            message = new MessageComponent();\n            message.message = messageReceived;\n            message.color = ChatColor.Received;\n            message.date = new Date().toLocaleTimeString('it-IT');\n        }\n        this.messages.unshift(message);\n        if (!isReplay) this.saveReplay.saveAction(this.currentTime, 'chatMessageReceived', message);\n    };\n\n    /**\n     * Handles the reception of a message from the server and displays it on this client's chat\n     *\n     * @param text the text the server wants to send\n     * @param isReplay true if the message is sent during a replay, false otherwise\n     */\n    handleServerMessage = (text: string, isReplay?: boolean, message?: MessageComponent) => {\n        if (!message) {\n            message = new MessageComponent();\n            message.color = ChatColor.Server;\n            message.message = { sender: 'SERVEUR', text };\n            message.date = new Date().toLocaleTimeString('it-IT');\n        }\n        this.messages.unshift(message);\n        if (!isReplay) this.saveReplay.saveAction(this.currentTime, 'serverMessage', message);\n    };\n\n    /**\n     * Handles the reception of a message from the server when the client beats the best time and displays it on this client's chat\n     *\n     * @param text the text the server wants to send\n     * @param isReplay true if the message is sent during a replay, false otherwise\n     * @param message the message to display\n     */\n    handleNewBestTimeMessage = (text: string, isReplay?: boolean, message?: MessageComponent) => {\n        if (!message) {\n            message = new MessageComponent();\n            message.color = ChatColor.BestTime;\n            message.message = { sender: 'SERVEUR', text };\n            message.date = new Date().toLocaleTimeString('it-IT');\n        }\n        this.messages.unshift(message);\n        if (!isReplay) this.saveReplay.saveAction(this.currentTime, 'serverMessage', message);\n    };\n\n    /**\n     * Handles a time update from the server (every 100ms). The replay saves the time update every second when the time % 1000 is 0.\n     *\n     * @param time the time the server sends\n     * @param isReplay true if the time is sent during a replay, false otherwise\n     */\n    handleGameTimeUpdated = (time: number, isReplay?: boolean) => {\n        this.serverTimer.next(time);\n        if (this.currentTime % PlaybackConstants.MsInSec === 0 && !isReplay) {\n            this.saveReplay.saveAction(this.currentTime, 'time', time);\n        }\n    };\n\n    /**\n     * Handles a user click on the canvases that doesn't correspond to a difference. The client is frozen for 1 second and the error is displayed.\n     *\n     * @param pos the pixel the client clicked\n     * @param isReplay true if the click is sent during a replay, false otherwise\n     */\n    handleErrorClick = (pos: Pixel, isReplay?: boolean) => {\n        this.playFeedbackSound(false);\n        this.frozenByError = true;\n        this.gameFeedbackService.drawError(pos);\n        setTimeout(() => {\n            this.frozenByError = false;\n            this.gameFeedbackService.clearError();\n        }, this.errorDelay);\n        if (!isReplay) this.saveReplay.saveAction(this.currentTime, 'error', pos);\n    };\n\n    handleCheating() {\n        this.saveReplay.saveAction(this.currentTime, 'cheating', this.gameFeedbackService.isCheating);\n    }\n\n    handleDifferenceFound(playerName: string, difference: Pixel[]) {\n        this.saveReplay.saveAction(this.currentTime, 'difference', { playerName, difference });\n    }\n\n    startReplay() {\n        this.messages.splice(0);\n        this.gameFeedbackService.clearDifferences();\n    }\n\n    reload() {\n        window.location.reload();\n    }\n\n    updateSettings(initialTime: number, penaltyTime: number, bonusTime: number) {\n        this.socketService.send('updateSettings', { initialTime, penaltyTime, bonusTime } as GameSettings);\n    }\n\n    resetTime(gameTitle?: string) {\n        if (gameTitle) this.socketService.send('resetGameBestTimes', gameTitle);\n        else this.socketService.send('resetAllBestTimes');\n    }\n}\n"},"src/fuzz.ts":{"language":"typescript","mutants":[{"id":"1478","mutatorName":"StringLiteral","replacement":"\"\"","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":37,"line":20},"start":{"column":33,"line":20}}},{"id":"1479","mutatorName":"BooleanLiteral","replacement":"false","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":43,"line":20},"start":{"column":39,"line":20}}},{"id":"1480","mutatorName":"Regex","replacement":"/\\.fuzz\\.ts/","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":58,"line":20},"start":{"column":45,"line":20}}}],"source":"// This file is required by karma.conf.js and loads recursively all the .spec and framework files\r\nimport { getTestBed } from '@angular/core/testing';\r\nimport { BrowserDynamicTestingModule, platformBrowserDynamicTesting } from '@angular/platform-browser-dynamic/testing';\r\nimport 'zone.js/testing';\r\n\r\ndeclare const require: {\r\n    context(\r\n        path: string,\r\n        deep?: boolean,\r\n        filter?: RegExp,\r\n    ): {\r\n        <"+"T>(id: string): T;\r\n        keys(): string[];\r\n    };\r\n};\r\n\r\n// First, initialize the Angular testing environment.\r\ngetTestBed().initTestEnvironment(BrowserDynamicTestingModule, platformBrowserDynamicTesting());\r\n// Then we find all the tests.\r\nconst context = require.context('./', true, /\\.fuzz\\.ts$/);\r\n// And load the modules.\r\ncontext.keys().map(context);\r\n"},"src/main.ts":{"language":"t ATA) public data: { canvas: HTMLCanvasElement },\n        private compareService: CompareService,\n        private dialogRef: MatDialogRef<"+"ComparePopupComponent>,\n    ) {\n        this.title = '';\n        this.difficulty = '';\n        this.displayedMessage = '';\n    }\n\n    /**\n     * Validates the differences between the two canvases.\n     * Called when the pop-up component is initialized.\n     */\n    ngOnInit(): void {\n        this.onValidate();\n    }\n\n    /**\n     * Adds the canvas element to the DOM to show the differences between the canvases.\n     * Called after the pop-up component is initialized.\n     */\n    ngAfterViewInit(): void {\n        this.content.nativeElement.appendChild(this.data.canvas);\n    }\n\n    /**\n     * Validates the differences between the two canvases.\n     * Changes the message to be displayed on the pop-up if the number of differences is invalid.\n     * Called when the user clicks on the comparison button.\n     */\n    onValidate(): void {\n        const { difficulty, nbDifferences } = this.compareService.validateDifferences();\n        this.difficulty = difficulty;\n\n        this.displayedMessage =\n            this.difficulty === 'invalide'\n                ? `Erreur : nombre de diffrences invalide (${nbDifferences} trouve` +\n                  (nbDifferences <"+"= 1 ? '' : 's') +\n                  ', veuillez en gnrer entre 3 et 9).'\n                : 'Niveau : ' + this.difficulty + ' avec ' + nbDifferences + ' diffrences.';\n    }\n\n    /**\n     * Creates a new game with the given title and difficulty and sends it to the server.\n     * If the title already exists, an error message is displayed.\n     * Called when the user clicks on the confirmation button.\n     */\n    onSubmit(): void {\n        this.compareService.createGame(this.title, this.difficulty).subscribe((exists) => {\n            if (!exists) this.dialogRef.close(true);\n            else this.displayedMessage = 'Erreur: ce titre existe dj.';\n        });\n    }\n\n    /**\n     * Updates the title of the game.\n     * Called when the user types in the input field.\n     *\n     * @param input the input field\n     */\n    onInput(input: HTMLInputElement, submitButton: HTMLButtonElement): void {\n        const prohibitedChars: string[] = ['/', '\\\\', ':', '*', '?', '\"', '<"+"', '>', '|'];\n        let isValidInput = false;\n        this.title = input.value;\n        if (this.title.length > 0) isValidInput = true;\n\n        for (const char of prohibitedChars) {\n            if (this.title.includes(char)) {\n                isValidInput = false;\n            }\n        }\n        submitButton.disabled = !isValidInput;\n    }\n}\n"},"src/app/components/creation-page/custom-slider/custom-slider.component.ts":{"language":"typescript","mutants":[{"id":"201","mutatorName":"BlockStatement","replacement":"{}","statusReason":"TypeError: Cannot read properties of undefined (reading 'emit')\n    at CustomSliderComponent.onInputChange (src/app/components/creation-page/custom-slider/custom-slider.component.ts:95:30)\n    at UserContext.apply (src/app/components/creation-page/custom-slider/custom-slider.component.spec.ts:33:19)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at runInTestZone (node_modules/zone.js/fesm2015/zone-testing.js:582:34)\n    at UserContext.<"+"anonymous> (node_modules/zone.js/fesm2015/zone-testing.js:597:20)\n    at <"+"Jasmine>\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at apply (node_modules/zone.js/fesm2015/zone.js:1275:36)\n    at _ZoneDelegate.invokeTask (node_modules/zone.js/fesm2015/zone.js:406:31)\n    at Zone.runTask (nod les[0]\n                ? await this.compareService.drawImage(input.files[0], canvas.getContext('2d') as CanvasRenderingContext2D)\n                : 'Fichier introuvable';\n        input.value = '';\n        if (this.uploadMessage !== '') {\n            alert(this.uploadMessage);\n        }\n    }\n\n    /**\n     * Clears the image on the canvas by filling it with a white background.\n     * Called when the user clicks on the clear button (trash can icon).\n     *\n     * @param canvas the canvas element that contains the image to be cleared.\n     */\n    clearImage(canvas: HTMLCanvasElement): void {\n        const canvasContext = canvas.getContext('2d') as CanvasRenderingContext2D;\n        canvasContext.fillStyle = 'white';\n        canvasContext.fillRect(0, 0, canvas.width, canvas.height);\n    }\n\n    /**\n     * Resets the second layer of the canvas (the drawings).\n     * Called when the user clicks on the reset button (loop icon on either side).\n     */\n    resetOverlay(): void {\n        this.canvasManagerService.resetOverlay(this.canvas.nativeElement);\n    }\n}\n"},"src/app/components/creation-page/toolbar/toolbar.component.ts":{"language":"typescript","mutants":[{"id":"237","mutatorName":"BlockStatement","replacement":"{}","statusReason":"TypeError: Cannot set properties of undefined (setting 'width')\n    at ToolbarComponent.call [as ngAfterViewInit] (src/app/components/creation-page/toolbar/toolbar.component.ts:102:35)\n    at callHook (node_modules/@angular/core/fesm2015/core.mjs:2488:22)\n    at callHooks (node_modules/@angular/core/fesm2015/core.mjs:2457:17)\n    at executeInitAndCheckHooks (node_modules/@angular/core/fesm2015/core.mjs:2408:9)\n    at refreshView (node_modules/@angular/core/fesm2015/core.mjs:12046:21)\n    at renderComponentOrTemplate (node_modules/@angular/core/fesm2015/core.mjs:12092:9)\n    at tickRootContext (node_modules/@angular/core/fesm2015/core.mjs:13247:13)\n    at detectChangesInRootView (node_modules/@angular/core/f rom '@angular/router';\nimport { Tool } from '@app/classes/tool';\nimport { ComparePopupComponent } from '@app/components/creation-page/compare-popup/compare-popup.component';\nimport { ImageConstants } from '@app/constants/constants';\nimport { CompareService } from '@app/services/compare.service';\nimport { DrawService } from '@app/services/draw.service';\nimport { HistoryService } from '@app/services/history.service';\n\n@Component({\n    selector: 'app-toolbar',\n    templateUrl: './toolbar.component.html',\n    styleUrls: ['./toolbar.component.scss'],\n})\nexport class ToolbarComponent implements AfterViewInit {\n    @ViewChild('toolbar', { read: ElementRef }) toolbar: ElementRef;\n\n    precision: number;\n    private differencesCanvas;\n    private iconContainers: Map<"+"string, HTMLDivElement>;\n\n    /**\n     * Constructor for the Toolbar Component.\n     * The max-params rule is disabled because the class requires every one of the services listed in the constructor.\n     *\n     * @param compareService Service used to compare the two canvases.\n     * @param drawService Service used to draw on the canvases.\n     * @param dialog Service used to open a dialog.\n     * @param history Service used to undo and redo actions.\n     * @param router Service used to navigate to another page.\n     */\n    // eslint-disable-next-line max-params\n    constructor(\n        private compareService: CompareService,\n        private dialog: MatDialog,\n        private drawService: DrawService,\n        private historyService: HistoryService,\n        private router: Router,\n    ) {\n        this.precision = 3;\n        this.differencesCanvas = document.createElement('canvas');\n    }\n\n    /**\n     * Triggers after the view is initialized.\n     * Sets the dimensions of the comparison canvas to default values (640px x 480px).\n     * Initializes the comparison canvas of the CompareService.\n     */\n    ngAfterViewInit(): void {\n        this.differencesCanvas.width = ImageConstants.DefaultWidth;\n        this.differencesCanvas.height = ImageConstants.DefaultHeight;\n        this.compareService.initDifferencesCanvas(this.differencesCanvas.getContext('2d') as CanvasRenderingContext2D);\n\n        this.iconContainers = new Map();\n        ['pencil', 'rectangle', 'eraser'].forEach((tool) =>\n            this.iconContainers.set(tool, this.toolbar.nativeElement.querySelector(`#${tool}`).parentElement),\n        );\n    }\n\n    /**\n     * Merges the first and second layers of the two canvases.\n     * Draws the differences between the two canvases on the comparison canvas.\n     * Opens a dialog to display the comparison canvas.\n     */\n    compare(): void {\n        this.compareService.mergeCanvases();\n        this.compareService.drawDifferences(this.precision);\n        const dialogRef = this.dialog.open(ComparePopupComponent, { data: { canvas: this.differencesCanvas }, panelClass: 'container' });\n        dialogRef.afterClosed().subscribe((result: boolean) => {\n            if (result) this.router.navigate(['/config']);\n        });\n    }\n\n    /**\n     * Sets the precision value indicated by the slider to the new value given by the user.\n     *\n     * @param $event The new precision value.\n     */\n    onPrecisionChange($event: number): void {\n        if ($event === null || this.precision === $event) return;\n        else this.precision = $event;\n    }\n\n    /**\n     * Enables or disables the tool given as parameter.\n     * If the tool is enabled, the icon is highlighted.\n     * If the tool is disabled, the icon is not highlighted.\n     *\n     * @param tool The tool to toggle.\n     */\n    toggleTool(tool: string): void {\n        this.drawService.toggleTool(tool);\n        this.iconContainers.forEach((container) => container.classList.remove('active'));\n        this.iconContainers.get(this.drawService.tool)?.classList.add('active');\n    }\n\n    /**\n     * Changes the color of the pencil in the draw service.\n     * This method is called when the pencil color is changed by the user.\n     *\n     * @param changeEvent The event that is triggered when the pencil color is changed.\n     * The value of the event target is the new color of the pencil.\n     */\n    changePencilColor(changeEvent: Event): void {\n        Tool.drawColor = (changeEvent.target as HTMLSelectElement).value;\n    }\n\n    /**\n     * Changes the width of the pencil in the draw service.\n     * This method is called when the pencil width is changed by the user.\n     *\n     * @param changeEvent The event that is triggered when the pencil width is changed.\n     * The value of the event target is the new width of the pencil.\n     */\n    changePencilWidth(changeEvent: Event): void {\n        Tool.drawWidth = parseInt((changeEvent.target as HTMLSelectElement).value, 10);\n    }\n\n    /**\n     * Changes the color of the rectangle in the draw service.\n     * This method is called when the rectangle color is changed by the user.\n     *\n     * @param changeEvent The event that is triggered when the rectangle color is changed.\n     * The value of the event target is the new color of the rectangle.\n     */\n    changeRectangleColor(changeEvent: Event): void {\n        Tool.rectangleColor = (changeEvent.target as HTMLSelectElement).value;\n    }\n\n    /**\n     * Changes the width of the eraser in the draw service.\n     * This method is called when the eraser width is changed by the user.\n     *\n     * @param changeEvent The event that is triggered when the eraser width is changed.\n     * The value of the event target is the new width of the eraser.\n     */\n    changeEraserWidth(changeEvent: Event): void {\n        Tool.eraserWidth = parseInt((changeEvent.target as HTMLSelectElement).value, 10);\n    }\n\n    /**\n     * Calls the undoAction method of the history service.\n     * This method undoes the last action performed on either canvas.\n     * This method is called when the undo button is clicked (back arrow icon in the toolbar).\n     */\n    undoAction(): void {\n        this.historyService.undoAction();\n    }\n\n    /**\n     * Calls the redoAction method of the history service.\n     * This method redoes the last action performed on either canvas.\n     * This method is called when the redo button is clicked (forward arrow in the toolbar).\n     */\n    redoAction(): void {\n        this.historyService.redoAction();\n    }\n}\n"},"src/app/components/creation-page/vertical-toolbar/vertical-toolbar.component.ts":{"language":"typescript","mutants":[{"id":"274","mutatorName":"BlockStatement","replacement":"{}","statusReason":"Expected spy swapOverlays to have been called.\n    at <"+"Jasmine>\n    at UserContext.apply (src/app/components/creation-page/vertical-toolbar/vertical-toolbar.component.spec.ts:42:21)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at runInTestZone (node_modules/zone.js/fesm2015/zone-testing.js:582:34)\n    at UserContext.<"+"anonymous> (node_modules/zone.js/fesm2015/zone-testing.js:597:20)\n    at <"+"Jasmine>\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at apply (node_modules/zone.js/fesm2015/zone.js:1275:36)\n    at _ZoneDelegate.invokeTask (node_modules/zone.js/fesm2015/zone.js:406:31)\n    at Zone.runTask (node_modules/zone.js/fesm2015/zone.js:178:47)\n    at drainMicroTaskQueue (node_modules/zone.js/fesm2015/zone.js:585:35)\n    at call (node_modules/zone.js/fesm2015/zone.js:491:21)\n    at apply (node_modules/zone.js/fesm2015/zone.js:476:48)\n    at data.args.<"+"computed> (node_modules/zone.js/fesm2015/zone.js:2385:32)","status":"Killed","static":false,"testsC it(): void {\n        this.playback.playbackSpeedSubject.subscribe((speed: number) => {\n            this.changePlaybackSpeed(speed);\n        });\n    }\n\n    /**\n     * Initializes the playback speed map with values 1, 2 and 4.\n     * This method is called after the view has been initialized.\n     */\n    ngAfterViewInit(): void {\n        // Creates a new map to store the playback speed icons.\n        this.playbackSpeeds = new Map();\n\n        // Initializes the playback speed map with values 1, 2 and 4.\n        // The no-magic-numbers rule is disabled because the numbers are not arbitrary, rather they are the only acceptable values.\n        // eslint-disable-next-line @typescript-eslint/no-magic-numbers\n        [1, 2, 4].forEach((speed) => this.playbackSpeeds.set(speed, this.speedOptions.nativeElement.querySelector(`#speed-${speed}`)));\n    }\n\n    /**\n     * Toggles the playback of the replay when the user clicks on the play/pause button.\n     * If the playback is currently paused, the playback is resumed.\n     * If the playback is currently playing, the playback is paused.\n     * The image of the button is also changed to reflect the current state of the playback.\n     */\n    togglePlay(): void {\n        if (this.playback.play) {\n            this.playback.pausePlayback();\n            this.playPause.nativeElement.src = '/assets/Images/play.png';\n        } else {\n            this.playback.resumePlayback();\n            this.playPause.nativeElement.src = '/assets/Images/pause.png';\n        }\n    }\n\n    /**\n     * Changes the playback speed when the user clicks on one of the speed icons (1X, 2X, 3X).\n     * The speed is changed to the value of the icon that was clicked.\n     * The icon that was clicked is highlighted to indicate that it is the current playback speed.\n     *\n     * @param speed the new playback speed (values 1, 2 and 4 are expected)\n     */\n    changePlaybackSpeed(speed: number): void {\n        this.playback.setPlaybackSpeed(speed);\n        this.gameFeedback.setFlickerSpeed(speed);\n        this.gameSocketService.setErrorDelay(speed);\n        this.playbackSpeeds.forEach((icon) => icon.classList.remove('active'));\n        (this.playbackSpeeds.get(speed) as HTMLDivElement).classList.add('active');\n    }\n\n    /**\n     * Restarts the replay from the beginning when the user clicks on the restart button.\n     * This method also clears the timeouts that make the differences flicker to prevent a bug where the differences would continue flickering.\n     */\n    restartReplay(): void {\n        if (this.gameFeedback.isCheating) this.gameFeedback.toggleCheat();\n        this.gameFeedback.clearTimeouts();\n        this.playback.stopPlayback(false);\n        this.playback.startPlayback();\n        this.playPause.nativeElement.src = '/assets/Images/pause.png';\n    }\n\n    /**\n     * Stops the replay and returns to the home page when the user clicks on the quit button.\n     * The playback is stopped and cleared to prevent the replay from playing again.\n     * The user is then redirected to the home page.\n     */\n    quitReplay(): void {\n        this.playback.stopPlayback(false);\n        this.playback.isPlaybackActive = false;\n        this.playback.clearPlayback();\n        this.router.navigate(['/home']);\n    }\n}\n"},"src/app/components/progress-counter/progress-counter.component.ts":{"language":"typescript","mutants":[{"id":"468","mutatorName":"BlockStatement","replacement":"{}","statusReason":"TypeError: counterService.differenceCounter.next is not a function\n    at UserContext.apply (src/app/components/progress-counter/progress-counter.component.spec.ts:59:42)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at r n\n    ngOnDestroy(): void {\n        if (this.nameSubscription) this.nameSubscription.unsubscribe();\n        window.removeEventListener('keydown', this.eventListener.bind(this));\n    }\n\n    onSubmit() {\n        if (this.data !== 'Jouer') {\n            this.gameSocketService.validateUsername(this.username);\n            this.nameSubscription = this.gameSocketService.isValidUsername.subscribe((isValid) => {\n                if (isValid) this.dialogRef.close(this.username);\n                else this.prompt = 'Ce nom est dj utilis';\n            });\n        } else this.dialogRef.close(this.username);\n    }\n\n    private eventListener(event: KeyboardEvent) {\n        if (event.key === 'Enter') this.onSubmit();\n    }\n}\n"},"src/app/pages/app/app.component.ts":{"language":"typescript","mutants":[{"id":"537","mutatorName":"BlockStatement","replacement":"{}","statusReason":"Expected false to be truthy.\n    at <"+"Jasmine>\n    at UserContext.apply (src/app/pages/app/app.component.spec.ts:42:32)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at runInTestZone (node_modules/zone.js/fesm2015/zone-testing.js:582:34)\n    at UserContext.<"+"anonymous> (node_modules/zone.js/fesm2015/zone-testing.js:597:20)\n    at <"+"Jasmine>\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at apply (node_modules/zone.js/fesm2015/zone.js:1275:36)\n    at _ZoneDelegate.invokeTask (node_modules/zone.js/fesm2015/zone.js:406:31)\n    at Zone.runTask (node_modules/zone.js/fesm2015/zone.js:178:47)\n    at drainMicroTaskQueue (node_modules/zone.js/fesm2015/zone.js:585:35), Error: 1 component threw errors during cleanup\n    at TestBedRender3 ],"source":"import { Component, ElementRef, OnInit, ViewChild } from '@angular/core';\nimport { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';\nimport { SettingsConsts } from '@app/constants/constants';\nimport { GameSocketService } from '@app/services/game-socket.service';\nimport { SheetContainerService } from '@app/services/sheet-container.service';\n\n@Component({\n    selector: 'app-config-page',\n    templateUrl: './config-page.component.html',\n    styleUrls: ['./config-page.component.scss'],\n})\nexport class ConfigPageComponent implements OnInit {\n    @ViewChild('validate', { read: ElementRef }) validate: ElementRef<"+"HTMLButtonElement>;\n    title: string;\n    initialTime: number;\n    penaltyTime: number;\n    bonusTime: number;\n    settingsForm: FormGroup;\n\n    constructor(public sheetContainer: SheetContainerService, public gameSocketService: GameSocketService, private formBuilder: FormBuilder) {\n        this.title = 'Configuration';\n        this.gameSocketService.settingsValue.subscribe((settings) => {\n            this.initialTime = settings.initialTime;\n            this.penaltyTime = settings.penaltyTime;\n            this.bonusTime = settings.bonusTime;\n        });\n    }\n\n    ngOnInit(): void {\n        this.initSettingsform();\n        this.sheetContainer.getSheets(0);\n    }\n\n    resetTime(gameTitle: string): void {\n        if (confirm('tes-vous sr de vouloir rinitialiser le meilleur temps de cette feuille?')) {\n            this.gameSocketService.resetTime(gameTitle);\n        }\n    }\n\n    resetAllBestTimes() {\n        if (confirm('tes-vous sr de vouloir rinitialiser tous les meilleurs temps?')) {\n            this.gameSocketService.resetTime();\n        }\n    }\n\n    initSettingsform(): void {\n        this.settingsForm = this.formBuilder.group({\n            initialTimeControl: new FormControl(this.initialTime, [\n                Validators.required,\n                Validators.min(SettingsConsts.MinCountdown),\n                Validators.max(SettingsConsts.MaxCountdown),\n                Validators.pattern('^[0-9]*$'),\n            ]),\n            penaltyTimeControl: new FormControl(this.penaltyTime, [\n                Validators.required,\n                Validators.min(SettingsConsts.MinIncrement),\n                Validators.max(SettingsConsts.MaxIncrement),\n                Validators.pattern('^[0-9]*$'),\n            ]),\n            bonusTimeControl: new FormControl(this.bonusTime, [\n                Validators.required,\n                Validators.min(SettingsConsts.MinIncrement),\n                Validators.max(SettingsConsts.MinCountdown),\n                Validators.pattern('^[0-9]*$'),\n            ]),\n        });\n    }\n\n    updateSettings(): void {\n        let buttonMessage = this.validate.nativeElement.innerText;\n        this.gameSocketService.updateSettings(this.initialTime, this.penaltyTime, this.bonusTime);\n        buttonMessage = 'Succs!';\n        this.validate.nativeElement.innerText = buttonMessage;\n        setTimeout(() => {\n            this.validate.nativeElement.innerText = 'Valider';\n        }, SettingsConsts.ValidateTimeout);\n    }\n\n    resetSettings(): void {\n        if (confirm('tes-vous sr de vouloir rinitialiser tous les meilleurs temps?')) {\n            this.initialTime = SettingsConsts.DefaultCountDown;\n            this.penaltyTime = SettingsConsts.DefaultIncrement;\n            this.bonusTime = SettingsConsts.DefaultIncrement;\n            this.gameSocketService.updateSettings(SettingsConsts.DefaultCountDown, SettingsConsts.DefaultIncrement, SettingsConsts.DefaultIncrement);\n        }\n    }\n}\n"},"src/app/pages/creation-page/creation.component.ts":{"language":"typescript","mutants":[{"id":"581","mutatorName":"BlockStatement","replacement":"{}","status":"Survived","static":false,"testsCompleted":4,"coveredBy":["146","147","148","149"],"location":{"end":{"column":6,"line":39},"start":{"column":7,"line":37}}} .clearRect(0, 0, canvas.width, canvas.height);\n    }\n\n    /**\n     * Swaps the overlays of the two canvases.\n     * This only applies to the draw layer. The background layer is not affected.\n     */\n    swapOverlays(): void {\n        this.historyService.saveState(this.historyService.undoArr, true);\n\n        this.drawCanvas(this.context1.canvas, this.context2.canvas);\n        this.drawCanvas(this.context2.canvas, this.context1.canvas);\n    }\n\n    /**\n     * Draws the other canvas on the overlay of the canvas given as parameter.\n     * This only applies to the draw layer. The background layer is not affected.\n     *\n     * @param destination the canvas on which the other canvas should be drawn.\n     * The value can be 'toLeft' or 'toRight'.\n     */\n    duplicate(destination: string): void {\n        this.historyService.saveState(this.historyService.undoArr, true);\n\n        if (destination === 'toLeft') {\n            this.drawCanvas(this.context1.canvas, this.context2.canvas);\n        } else {\n            this.drawCanvas(this.context2.canvas, this.context1.canvas);\n        }\n    }\n\n    /**\n     * Draws the canvas given as parameter canvasFrom on the canvas given as parameter canvasTo.\n     *\n     * @param canvasTo the canvas on which the other canvas should be drawn.\n     * @param canvasFrom the canvas that should be drawn on the other canvas.\n     */\n    private drawCanvas(canvasTo: HTMLCanvasElement, canvasFrom: HTMLCanvasElement): void {\n        const dataFrom = canvasFrom.toDataURL();\n        const image = new Image();\n        image.src = dataFrom;\n        image.onload = () => {\n            (canvasTo.getContext('2d') as CanvasRenderingContext2D).clearRect(0, 0, canvasTo.width, canvasTo.height);\n            (canvasTo.getContext('2d') as CanvasRenderingContext2D).drawImage(image, 0, 0);\n        };\n    }\n}\n"},"src/app/services/communication.service.ts":{"language":"typescript","mutants":[{"id":"645","mutatorName":"BlockSta        this.baseContext2 &&\n            this.baseContext1.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data.some((channel) => channel !== 0) &&\n            this.baseContext2.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data.some((channel) => channel !== 0)\n        );\n    }\n\n    /**\n     * Initializes the service's CanvasRenderingContext2Ds'. Should be called after the view is loaded.\n     * Sets the virtual canvas' dimensions to the default image dimensions. These canvases are used to merge the layers.\n     *\n     * @param original The left canvas' ImageInputComponent.\n     * @param modified The right canvas' ImageInputComponent.\n     */\n    // More than maximum params is allowed because creating an interface for this few canvas layers would not improve readability significantly\n    // eslint-disable-next-line max-params\n    initContexts(\n        originalLayer1: CanvasRenderingContext2D,\n        originalLayer2: CanvasRenderingContext2D,\n        modifiedLayer1: CanvasRenderingContext2D,\n        modifiedLayer2: CanvasRenderingContext2D,\n    ): void {\n        this.baseContext1 = originalLayer1;\n        this.baseContext2 = modifiedLayer1;\n\n        this.overContext1 = originalLayer2;\n        this.overContext2 = modifiedLayer2;\n\n        this.setVirtualCanvasSize();\n\n        this.virtualContext1 = this.virtualCanvas1.getContext('2d') as CanvasRenderingContext2D;\n        this.virtualContext2 = this.virtualCanvas2.getContext('2d') as CanvasRenderingContext2D;\n    }\n\n    /**\n     * Sets the differenceContext attribute to the context given as parameter.\n     * The context is used to draw the differences between the two images in the pop-up component.\n     *\n     * @param differencesContext The context of the canvas to be used to draw the differences.\n     */\n    initDifferencesCanvas(differencesContext: CanvasRenderingContext2D): void {\n        this.differencesContext = differencesContext;\n    }\n\n    /**\n     * Verifies the input's file, image format, bit depth and resolution before displaying on the canvas\n     * (displays on both original and modified if no context is provided).\n     *\n     * @param file The input containing the image.\n     * @param context The specific context with which to display, if not both.\n     * @returns The asynchronous error or validation message.\n     */\n    async drawImage(file: File, context?: CanvasRenderingContext2D) {\n        // Reads file\n        const reader = new FileReader();\n        reader.readAsArrayBuffer(file);\n        const view = await new Promise<"+"DataView>((resolve) => {\n            reader.onload = () => resolve(new DataView(reader.result as ArrayBuffer));\n        });\n\n        // Verifies BMP format\n        if (view.getUint8(0) !== ImageConstants.BmpFormat0 || view.getUint8(1) !== ImageConstants.BmpFormat1)\n            return 'Le fichier doit tre dans un format BMP';\n\n        // Verifies 24 bit depth\n        if (view.getUint16(ImageConstants.BitDepthOffset, true) !== ImageConstants.BitDepth24) return 'Le fichier BMP doit tre 24-bit';\n\n        // Generates image\n        const newImage = new Image();\n        newImage.src = window.URL.createObjectURL(file);\n        await new Promise<"+"HTMLImageElement>((resolve) => {\n            newImage.onload = () => resolve(newImage);\n        });\n\n        // Verifies resolution\n        if (newImage.naturalWidth !== ImageConstants.DefaultWidth || newImage.naturalHeight !== ImageConstants.DefaultHeight)\n            return \"L'image doit tre de rsolution 640 x 480 pixels\";\n\n        // Draws image(s)\n        if (context) context.drawImage(newImage, 0, 0);\n        else {\n            this.baseContext1.drawImage(newImage, 0, 0);\n            this.baseContext2.drawImage(newImage, 0, 0);\n        }\n        return '';\n    }\n\n    /**\n     * Resets a canvas' display.\n     *\n     * @param context The context of the canvas to be reset.\n     */\n    clearImage(context: CanvasRenderingContext2D): void {\n        context.clearRect(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight);\n    }\n\n    /**\n     * Compares the original and modified canvas to draw the differences on the third.\n     *\n     * @param enlargement The value by which to enlarge the drawn different pixels.\n     */\n    drawDifferences(enlargement: number): void {\n        // Resets the differences canvas\n        this.differencesContext.fillStyle = 'white';\n        this.differencesContext.fillRect(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight);\n        this.differencesContext.fillStyle = 'black';\n\n        // Gets original and modified images data\n        const originalData = this.virtualContext1.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data;\n        const modifiedData = this.virtualContext2.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data;\n\n        for (let y = 0; y <"+" ImageConstants.DefaultHeight; y++) {\n            for (let x = 0; x <"+" ImageConstants.DefaultWidth; x++) {\n                // Converts x and y coordinates into an RGBA array index\n                const i = (x + y * ImageConstants.DefaultWidth) * ImageConstants.RgbaComponentsPerPixel;\n\n                // Compares pixels under an arbitrary tolerance\n                if (\n                    Math.abs(originalData[i] - modifiedData[i]) +\n                        Math.abs(originalData[i + 1] - modifiedData[i + 1]) +\n                        Math.abs(originalData[i + 2] - modifiedData[i + 2]) >\n                    ImageConstants.RgbaTolerance\n                )\n                    // Draws the difference according to enlargement\n                    this.differencesContext.fillRect(\n                        Math.max(x - enlargement, 0),\n                        Math.max(y - enlargement, 0),\n                        1 + Math.min(ImageConstants.DefaultWidth - x - 1, enlargement) + Math.min(x, enlargement),\n                        1 + Math.min(ImageConstants.DefaultWidth - y - 1, enlargement) + Math.min(y, enlargement),\n                    );\n            }\n        }\n    }\n\n    /**\n     * Counts the number of differences to set the game's validity for upload.\n     *\n     * @returns An object containing the computed difficulty and number of differences.\n     */\n    validateDifferences() {\n        this.differencesCoords = [];\n        let data = this.differencesContext.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data;\n\n        for (let y = 0; y <"+" ImageConstants.DefaultHeight; y++)\n            for (let x = 0; x <"+" ImageConstants.DefaultWidth; x++)\n                if (data[(x + y * ImageConstants.DefaultWidth) * ImageConstants.RgbaComponentsPerPixel] === 0) data = this.floodFill(x, y, data);\n\n        return { difficulty: this.getDifficulty(), nbDifferences: this.differencesCoords.length };\n    }\n\n    /**\n     * Creates a game with the correct settings provided by the compare service.\n     * It then uses an observable to post the new game to the server with the communication service.\n     *\n     * @param gameTitle a string representing the title of the game.\n     * @param diff a string representing the difficulty level of the game.\n     * @returns a boolean observable that depends on the titleExistsGet request of the communication service.\n     */\n    createGame(gameTitle: string, diff: string): Observable<"+"boolean> {\n        const myObservable = this.communicationService.titleExistsGet(gameTitle);\n\n        myObservable.subscribe((exists: boolean) => {\n            if (!exists) {\n                const firstImage = this.virtualCanvas1.toDataURL();\n                const secondImage = this.virtualCanvas2.toDataURL();\n\n                const game: Game = {\n                    title: gameTitle,\n                    image1: firstImage,\n                    image2: secondImage,\n                    differences: this.differencesCoords,\n                    bestTimes: {\n                        solo: [],\n                        versus: [],\n                    },\n                    isHard: diff === 'difficile',\n                };\n                this.communicationService.createGamePost(game).subscribe();\n                this.clearImage(this.virtualContext1);\n                this.clearImage(this.virtualContext2);\n            }\n        });\n        return myObservable;\n    }\n\n    /**\n     * Merges the first and second layer of the ImageInputComponents into a single virtual canvas (not displayed anywhere).\n     * Draws the second layers (function parameters) on the service's context attributes.\n     *\n     * @param originalLayer the second layer of the left ImageInputComponent.\n     * @param modifiedLayer the second layer of the right ImageInputComponent.\n     */\n    mergeCanvases(): void {\n        this.virtualContext1.drawImage(this.baseContext1.canvas, 0, 0);\n        this.virtualContext1.drawImage(this.overContext1.canvas, 0, 0);\n        this.virtualContext2.drawImage(this.baseContext2.canvas, 0, 0);\n        this.virtualContext2.drawImage(this.overContext2.canvas, 0, 0);\n    }\n\n    /**\n     * Performs the flood fill algorithm to find a set of different pixels based on initial coordinates and\n     * the up-to-date image data.\n     *\n     * @param x0 The initial x coordinate.\n     * @param y0 The initial y coordinate.\n     * @param data The initial image data.\n     * @returns The image data updated with marked found pixels.\n     */\n    private floodFill(x0: number, y0: number, data: Uint8ClampedArray): Uint8ClampedArray {\n        const queue = [[x0, y0]]; // Queues the initial pixel\n        const differenceCoords: Pixel[] = [];\n        while (queue.length) {\n            const [x, y] = queue.pop() as number[];\n            const i = (x + y * ImageConstants.DefaultWidth) * ImageConstants.RgbaComponentsPerPixel; // Computes RGBA index\n            // Evaluates if pixel has been visited\n            if (data[i] === 0) {\n                differenceCoords.push({ x, y });\n                data[i] = 1;\n\n                // Queues adjacent pixels\n                [\n                    [x - 1, y],\n                    [x + 1, y],\n                    [x, y - 1],\n                    [x, y + 1],\n                    [x - 1, y - 1],\n                    [x + 1, y - 1],\n                    [x - 1, y + 1],\n                    [x + 1, y + 1],\n                ].forEach(([xx, yy]) => {\n                    const xxInBounds = xx >= 0 && xx <"+" ImageConstants.DefaultWidth;\n                    const yyInBounds = yy >= 0 && yy <"+" ImageConstants.DefaultHeight;\n                    if (xxInBounds && yyInBounds) queue.push([xx, yy]);\n                });\n            }\n        }\n        this.differencesCoords.push(differenceCoords); // Adds difference to the set\n        return data;\n    }\n\n    /**\n     * Determines a valid game's difficulty by the number of differences and different pixels ratio.\n     *\n     * @returns The game's difficulty.\n     */\n    private getDifficulty(): string {\n        if (this.differencesCoords.length <"+" ImageConstants.NbDifferencesMin || this.differencesCoords.length > ImageConstants.NbDifferencesMax)\n            return 'invalide';\n        return this.differencesCoords.reduce((acc, difference) => acc + difference.length, 0) /\n            (ImageConstants.DefaultWidth * ImageConstants.DefaultHeight) <"+"=\n            ImageConstants.DifficultyPercentage && this.differencesCoords.length >= ImageConstants.NbDifferencesHardDifficulty\n            ? 'difficile'\n            : 'facile';\n    }\n\n    /**\n     * Sets the height and width of the virtual canvases to the default image size (640px x 480px).\n     */\n    private setVirtualCanvasSize(): void {\n        this.virtualCanvas1.width = ImageConstants.DefaultWidth;\n        this.virtualCanvas1.height = ImageConstants.DefaultHeight;\n        this.virtualCanvas2.width = ImageConstants.DefaultWidth;\n        this.virtualCanvas2.height = ImageConstants.DefaultHeight;\n    }\n}\n"},"src/app/services/counter.service.ts":{"language":"typescript","mutants":[{"id":"907","mutatorName":"BlockStatement","replacement":"{}","statusReason":"TypeError: Cannot read properties of undefined (reading 'subscribe')\n    at DifferenceCounterComponent.call [as ngOnInit] (src/app/components/difference-counter/difference-counter.component.ts:79:45)\n    at callHook (node_modules/@angular/core/fesm2015/core.mjs:2488:22)\n    at callHooks (node_modules/@angular/core/fesm2015/core.mjs:2457:17)\n    at executeInitAndCheckHooks (node_modules/@angular/core/fesm2015/core.mjs:2408:9)\n    at refreshView (node_modules/@angular/core/fesm2015/core.mjs:11990:21)\n    at renderComponentOrTemplate (node_modules/@angular/core/fesm2015/core.mjs:12092:9)\n    at tickRootContext (node_modules/@angular/core/fesm2015/core.mjs:13247:13)\n    at detectChangesInRootView (node_modules/@angular/core/fesm2015/core.mjs:13273:5)\n    at RootViewRef.detectChanges (node_modules/@angular/core/fesm2015/core.mjs:13790:9)\n    at ComponentFixture._tick (node_modules/@angular/core/fesm2015/testing.mjs:141:32)\n    at apply (node_modules/@angular/core/fesm2015/testing.mjs:154:22)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Object.onInvoke (node_modules/@angular/core/fesm2015/core.mjs:26356:33)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at NgZone.run (node_modules/@angular/core/fesm2015/core.mjs:26210:28)\n    at ComponentFixture.detectChanges (node_modules/@angular les/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at runInTestZone (node_modules/zone.js/fesm2015/zone-testing.js:582:34)\n    at UserContext.<"+"anonymous> (node_modules/zone.js/fesm2015/zone-testing.js:597:20)\n    at <"+"Jasmine>\n    at _ZoneDelegate.invokeTask (node_modules/zone.js/fesm2015/zone.js:406:31)\n    at Zone.runTask (node_modules/zone.js/fesm2015/zone.js:178:47)\n    at drainMicroTaskQueue (node_modules/zone.js/fesm2015/zone.js:585:35), Expected spy Rectangle.drawRectangle not to have been called.\n    at <"+"Jasmine>\n    at UserContext.apply (src/app/services/draw.service.spec.ts:183:49)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run (node_modules/zone.js/fesm2015/zone.js:134:43)\n    at runInTestZone (node_modules/zone.js/fesm2015/zone-testing.js:582:34)\n    at UserContext.<"+"anonymous> (node_modules/zone.js/fesm2015/zone-testing.js:597:20)\n    at <"+"Jasmine>\n    at _ZoneDelegate.invokeTask (node_modules/zone.js/fesm2015/zone.js:406:31)\n    at Zone.runTask (node_modules/zone.js/fesm2015/zone.js:178:47)\n    at drainMicroTaskQueue (node_modules/zone.js/fesm2015/zone.js:585:35)","status":"Killed","static":false,"testsCompleted":1,"killedBy":["213"],"coveredBy":["213","214"],"location":{"end":{"column":35,"line":124},"start":{"column":17,"line":124}}}],"source":"import { Injectable } from '@angular/core';\nimport { Eraser } from '@app/classes/eraser';\nimport { Pencil } from '@app/classes/pencil';\nimport { Rectangle } from '@app/classes/rectangle';\nimport { Tool } from '@app/classes/tool';\nimport { DrawConstants } from '@app/constants/constants';\nimport { HistoryService } from './history.service';\n\n@Injectable({\n    providedIn: 'root',\n})\nexport class DrawService {\n    private middleCtxLeft: CanvasRenderingContext2D;\n    private middleCtxRight: CanvasRenderingContext2D;\n    private topCtxLeft: CanvasRenderingContext2D;\n    private topCtxRight: CanvasRenderingContext2D;\n\n    private usingTool: boolean;\n    private activeTool: Tool | undefined;\n    private tools: { [key: string]: Tool };\n\n    constructor(private historyService: HistoryService) {\n        this.tools = {\n            pencil: new Pencil(),\n            eraser: new Eraser(),\n            rectangle: new Rectangle(),\n        };\n    }\n\n    get tool() {\n        return this.activeTool ? this.activeTool.toString() : '';\n    }\n\n    /**\n     * Initializes the draw service.\n     * Initialize the contexts with top layer and draw layer.\n     * Initialize the tool functions and the tool properties.\n     * Adds event listeners to the top layer of both canvases to handle mousedown, mouseup, keydown adn keyup events.\n     *\n     * @param canvas1 the left canvas.\n     * @param canvas2 the right canvas.\n     */\n    initContexts(canvas1: HTMLCanvasElement, canvas2: HTMLCanvasElement): void {\n        Tool.drawColor = DrawConstants.DefaultColor;\n        Tool.drawWidth = DrawConstants.DefaultWidth;\n        Tool.rectangleColor = DrawConstants.DefaultColor;\n        Tool.eraserWidth = DrawConstants.DefaultWidth;\n\n        this.middleCtxLeft = (canvas1.querySelector('canvas#layer-2') as HTMLCanvasElement).getContext('2d') as CanvasRenderingContext2D;\n        this.middleCtxRight = (canvas2.querySelector('canvas#layer-2') as HTMLCanvasElement).getContext('2d') as CanvasRenderingContext2D;\n        this.topCtxLeft = (canvas1.querySelector('canvas#layer-3') as HTMLCanvasElement).getContext('2d') as CanvasRenderingContext2D;\n        this.topCtxRight = (canvas2.querySelector('canvas#layer-3') as HTMLCanvasElement).getContext('2d') as CanvasRenderingContext2D;\n\n        this.topCtxLeft.lineJoin = 'round';\n        this.topCtxLeft.lineCap = 'round';\n        this.topCtxRight.lineJoin = 'round';\n        this.topCtxRight.lineCap = 'round';\n        this.middleCtxLeft.lineCap = 'square';\n        this.middleCtxRight.lineCap = 'square';\n\n        this.topCtxLeft.canvas.addEventListener('mousedown', this.startTool);\n        this.topCtxRight.canvas.addEventListener('mousedown', this.startTool);\n        window.addEventListener('mouseup', this.stopTool);\n        window.addEventListener('keydown', this.changeShapeType);\n        window.addEventListener('keyup', this.changeShapeType);\n    }\n\n    /**\n     * Enables or disables the tool given as parameter.\n     *\n     * @param tool The tool to enable. Values can be 'pencil', 'rectangle' or 'eraser'.\n     */\n    toggleTool(tool: string): void {\n        const newTool = this.tools[tool];\n        this.activeTool = this.activeTool === newTool ? undefined : newTool;\n    }\n\n    /**\n     * Global event handler that resolves which tool's functions to call for mousedown and\n     * to add as event handlers for mousemove and mouseover.\n     *\n     * @param event the mousedown event.\n     */\n    private startTool = (event: MouseEvent) => {\n        if (!this.activeTool) return;\n\n        if (event.target === this.topCtxLeft.canvas) {\n            Tool.currentMiddleCtx = this.middleCtxLeft;\n            Tool.currentTopCtx = this.topCtxLeft;\n        } else {\n            Tool.currentMiddleCtx = this.middleCtxRight;\n            Tool.currentTopCtx = this.topCtxRight;\n        }\n\n        this.usingTool = true;\n        this.historyService.saveState(this.historyService.undoArr, true);\n        Tool.currentTopCtx.canvas.addEventListener('mousemove', this.activeTool.move);\n        Tool.currentTopCtx.canvas.addEventListener('mouseover', this.activeTool.enter);\n        this.activeTool.start(event);\n    };\n\n    /**\n     * Global event handler that resolves which tool's functions to call for mouseup and\n     * to remove from event handlers for mousemove and mouseover.\n     */\n    private stopTool = () => {\n        if (!this.activeTool) return;\n        this.usingTool = false;\n        Tool.currentTopCtx.canvas.removeEventListener('mousemove', this.activeTool.move);\n        Tool.currentTopCtx.canvas.removeEventListener('mouseover', this.activeTool.enter);\n        this.activeTool.stop();\n    };\n\n    /**\n     * Event handler which switches to or from square shape drawing.\n     *\n     * @param event the KeyBoardEvent\n     */\n    private changeShapeType = (event: KeyboardEvent) => {\n        if (this.activeTool === this.tools.rectangle && event.key === 'Shift') {\n            const rectangle = this.activeTool as Rectangle;\n            rectangle.isSquare = event.type === 'keydown';\n            if (!this.usingTool) return;\n            if (rectangle.isSquare) rectangle.drawSquare();\n            else rectangle.drawRectangle();\n        }\n    };\n}\n"},"src/app/services/game-feedback.service.ts":{"language":"typescript","mutants":[{"id":"976","mutatorName":"BooleanLiteral","replacement":"true","status":"Survived","static":false,"testsCompleted":138,"coveredBy":["28","29","31","32","33","76","77","78","79","80","81","82","83","91","92","93","94","95","96","97","112","113","114","115","116","117","118","119","120","121","122","123","124","125","128","129","130","131","132","133","134","152","153","154","155","156","157","158","159","215","216","217","218","219","220","221","222","223","224","225","226","227","228","229","230","231","232","233","234","235","236","237","238","239","240","241","242","243","244","245","246","247","248","249","250","251","252","253","254","255","256","257","258","259","260","261","262","263","264","265","266","267","268","269","270","271","272","273","274","275","276","277","278","290","291","292","293","294","295","296","297","298","299","300","301","302","303","304","305","306","307","308","309","328","329","330","331","332"],"l
