urce":"import { Injectable } from '@angular/core';\nimport { GameFeedbackConstants, ImageConstants, QUADRANT_SIZES } from '@app/constants/constants';\nimport { PlayAreaLayers } from '@app/interfaces/play-area-layers';\nimport { Pixel } from '@common/pixel';\n\n/**\n * Displays found differences and errors on the PlayAreaComponents' canvas layers\n *\n * @description\n * This service draws or flickers found differences, validated by the server, one layer above the images canvas.\n * It also draws and clears errors on a separate layer. This division by layers allows for simple operations, as\n * a modification never alters the images canvas and can thus be easily reverted.\n */\n@Injectable({\n    providedIn: 'root',\n})\nexport class GameFeedbackService {\n    isCheating: boolean;\n    currentErrorCtx: CanvasRenderingContext2D;\n    nbClues: number;\n\n    private flickerSpeed: number;\n    private cheatingSpeed: number;\n\n    private leftLayers: PlayAreaLayers;\n    private rightLayers: PlayAreaLayers;\n    private leftData: Uint8ClampedArray;\n    private rightData: Uint8ClampedArray;\n\n    private tempCanvas: HTMLCanvasElement;\n    private tempCtx: CanvasRenderingContext2D;\n\n    private flickerOuter: ReturnType<"+"typeof setInterval>;\n    private flickerInner: ReturnType<"+"typeof setInterval>;\n\n    private flickerTimeoutId: ReturnType<"+"typeof setTimeout>;\n    private isFlickering: boolean;\n\n    constructor() {\n        this.isCheating = false;\n        this.flickerSpeed = GameFeedbackConstants.FlickerDelay;\n        this.cheatingSpeed = GameFeedbackConstants.CheatFlickerDelay;\n\n        this.tempCanvas = document.createElement('canvas');\n        this.tempCanvas.width = ImageConstants.DefaultWidth;\n        this.tempCanvas.height = ImageConstants.DefaultHeight;\n        this.tempCtx = this.tempCanvas.getContext('2d') as CanvasRenderingContext2D;\n    }\n\n    get left(): PlayAreaLayers {\n        return this.leftLayers;\n    }\n\n    get right(): PlayAreaLayers {\n        return this.rightLayers;\n    }\n\n    /**\n     * Initializes images and found differences CanvasRenderingContext2Ds. Stores images data.\n     * Should be called after both images have loaded on their canvas in PlayAreaComponent.\n     *\n     * @param leftLayers The original canvas image and differences layers, as CanvasRenderingContext2ds.\n     * @param rightLayers The modified canvas image and differences layers, as CanvasRenderingContext2ds.\n     */\n    initData(leftLayers: PlayAreaLayers, rightLayers: PlayAreaLayers) {\n        this.leftLayers = leftLayers;\n        this.leftData = leftLayers.image.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data;\n        this.rightLayers = rightLayers;\n        this.rightData = rightLayers.image.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data;\n    }\n\n    setFlickerSpeed(speed: number) {\n        this.flickerSpeed = GameFeedbackConstants.FlickerDelay / speed;\n        this.cheatingSpeed = GameFeedbackConstants.CheatFlickerDelay / speed;\n        this.rightLayers.clue.canvas.style.animationDuration = (GameFeedbackConstants.FlickerAnimationFactor / this.flickerSpeed).toLocaleString();\n        this.leftLayers.clue.canvas.style.animationDuration = (GameFeedbackConstants.FlickerAnimationFactor / this.flickerSpeed).toLocaleString();\n    }\n\n    /**\n     * Draws an original canvas' difference on the modified canvas, flickering it if isCheating is false.\n     *\n     * @param difference The array of pixels to draw.\n     */\n    drawDifference(difference: Pixel[]) {\n        this.clearClueCanvas();\n        if (this.isCheating) this.patchDifference(difference, this.leftData);\n        else this.flicker(difference, GameFeedbackConstants.NbFlickers);\n    }\n\n    /**\n     * Draws word 'Erreur' at specified position. Should be called after currentErrorCtx is set to last clicked canvas' context.\n     *\n     * @param pixel The position at which to draw word on currentErrorCtx.\n     */\n    drawError(pixel: Pixel) {\n        this.currentErrorCtx.fillText('Erreur', pixel.x, pixel.y);\n    }\n\n    /**\n     * Clears word 'Error' on currentErrorCtx. Should be called after user is unfrozen from an error.\n     * currentErrorCtx should not have changed while user was frozen.\n     */\n    clearError() {\n        this.currentErrorCtx.clearRect(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight);\n    }\n\n    /**\n     * Toggles cheating. isCheating should be set with this method to trigger differences flickering.\n     * isCheating can be set directly to false if cheating shouldn't carry through multiple games.\n     */\n    toggleCheat() {\n        this.isCheating = !this.isCheating;\n        if (this.isCheating && !this.isFlickering) this.flickerCheat();\n    }\n\n    /**\n     * Creates visual feedback on usage of a clue.\n     *\n     * @param pixels The pixel from which to compute the clue quadrant, or pixels to shake for the third custom clue.\n     */\n    useClue(pixels: Pixel[]) {\n        this.clearClueCanvas();\n        if (this.nbClues > 1) {\n            this.leftLayers.clue.canvas.classList.remove('shake');\n            this.rightLayers.clue.canvas.classList.remove('shake');\n            this.leftLayers.clue.fillStyle = 'rgba(0, 255, 0, 0.3)';\n            this.rightLayers.clue.fillStyle = 'rgba(0, 255, 0, 0.3)';\n\n            const sizeIndex = this.nbClues-- - 2;\n            const x = QUADRANT_SIZES[sizeIndex].width * Math.floor(pixels[0].x / QUADRANT_SIZES[sizeIndex].width);\n            const y = QUADRANT_SIZES[sizeIndex].height * Math.floor(pixels[0].y / QUADRANT_SIZES[sizeIndex].height);\n            this.leftLayers.clue.fillRect(x, y, QUADRANT_SIZES[sizeIndex].width, QUADRANT_SIZES[sizeIndex].height);\n            this.rightLayers.clue.fillRect(x, y, QUADRANT_SIZES[sizeIndex].width, QUADRANT_SIZES[sizeIndex].height);\n        } else if (this.nbClues-- === 1) {\n            this.leftData = this.leftLayers.image.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data;\n            this.rightData = this.rightLayers.image.getImageData(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight).data;\n            this.patchDifference(pixels);\n            this.leftLayers.clue.canvas.classList.add('shake');\n            this.rightLayers.clue.canvas.classList.add('shake');\n        }\n    }\n\n    /**\n     * Synchronizes clues and cheat flickering effects with the newly downloaded images, should be called on difference\n     * found in limited time game.\n     */\n    synchronizeNewSheet() {\n        this.clearClueCanvas();\n        clearTimeout(this.flickerTimeoutId);\n        if (this.isCheating) this.flickerCheat();\n    }\n\n    /**\n     * Removes all differences from the difference layers.\n     * Called when a user starts the replay of a game to put the layers back to their original state.\n     */\n    clearDifferences() {\n        this.leftLayers.diff.clearRect(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight);\n        this.rightLayers.diff.clearRect(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight);\n    }\n\n    /**\n     * Clears all timeouts set by this service when a difference flickers.\n     * This is necessary to prevent flickering when a user viewing a replay presses the restart button while a difference is flickering.\n     */\n    clearTimeouts() {\n        clearTimeout(this.flickerOuter);\n        clearTimeout(this.flickerInner);\n    }\n\n    /**\n     * Clears green quadrant overlay for clue, should be called when a difference is found or when the images change.\n     */\n    clearClueCanvas() {\n        this.leftLayers.clue.clearRect(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight);\n        this.rightLayers.clue.clearRect(0, 0, ImageConstants.DefaultWidth, ImageConstants.DefaultHeight);\n    }\n\n    /**\n     * Swaps the image layers and repeats until isCheating is false.\n     */\n    private flickerCheat() {\n        this.isFlickering = true;\n        this.flickerTimeoutId = setTimeout(() => {\n            this.tempCtx.drawImage(this.leftLayers.image.canvas, 0, 0);\n            this.leftLayers.image.drawImage(this.rightLayers.image.canvas, 0, 0);\n            this.rightLayers.image.drawImage(this.tempCanvas, 0, 0);\n            this.flickerTimeoutId = setTimeout(() => {\n                this.rightLayers.image.drawImage(this.leftLayers.image.canvas, 0, 0);\n                this.leftLayers.image.drawImage(this.tempCanvas, 0, 0);\n                if (this.isCheating) this.flickerCheat();\n                else this.isFlickering = false;\n            }, this.cheatingSpeed);\n        }, this.cheatingSpeed);\n    }\n\n    /**\n     * Swaps the difference layers with newly drawn difference from the image layers, repeating for flickering effect.\n     *\n     * @param difference The array of pixels to draw and swap.\n     * @param count The remaining number of times to swap layers.\n     */\n    private flicker(difference: Pixel[], count: number) {\n        this.flickerOuter = setTimeout(() => {\n            this.patchDifference(difference, this.rightData);\n            this.flickerInner = setTimeout(() => {\n                this.patchDifference(difference, this.leftData);\n                if (--count > 0) this.flicker(difference, count);\n            }, this.flickerSpeed);\n        }, this.flickerSpeed);\n    }\n\n    /**\n     * Takes an array of coordinates and draws from the specified data onto difference layers.\n     *\n     * @param difference The pixels which to take from specified data.\n     * @param data The canvas' image data to use for drawing on the difference layers.\n     */\n    private patchDifference(difference: Pixel[], data: Uint8ClampedArray | undefined = undefined) {\n        let fillStyle;\n        difference.forEach((pixel) => {\n            const i = (pixel.x + pixel.y * ImageConstants.DefaultWidth) * ImageConstants.RgbaComponentsPerPixel;\n            if (data) {\n                fillStyle = `rgb(${data[i]}, ${data[i + 1]}, ${data[i + 2]})`;\n                this.drawOnCanvas(this.rightLayers.diff, fillStyle, pixel);\n                this.drawOnCanvas(this.leftLayers.diff, fillStyle, pixel);\n            } else {\n                fillStyle = `rgb(${this.rightData[i]}, ${this.rightData[i + 1]}, ${this.rightData[i + 2]})`;\n                this.drawOnCanvas(this.rightLayers.clue, fillStyle, pixel);\n                fillStyle = `rgb(${this.leftData[i]}, ${this.leftData[i + 1]}, ${this.leftData[i + 2]})`;\n                this.drawOnCanvas(this.leftLayers.clue, fillStyle, pixel);\n            }\n        });\n    }\n\n    /**\n     * Draws on a single layer with given fillStyle, at given pixel.\n     *\n     * @param context The CanvasRenderingContext2d of the layer on which to draw.\n     * @param fillStyle The color of the pixel to be drawn.\n     * @param pixel The coordinate at which to draw on the layer.\n     */\n    private drawOnCanvas(context: CanvasRenderingContext2D, fillStyle: string, pixel: Pixel): void {\n        context.fillStyle = fillStyle;\n        context.fillRect(pixel.x, pixel.y, 1, 1);\n    }\n}\n"},"src/app/services/history.service.ts":{"language":"typescript","mutants":[{"id":"1274","mutatorName":"BlockStatement","replacement":"{}","statusReason":"TypeError: Cannot read properties of undefined (reading 'push')\n    at HistoryService.saveState (src/app/services/history.service.ts:132:11)\n    at CanvasManagerService.resetOverlay (src/app/services/canvas-manager.service.ts:90:27)\n    at UserContext.apply (src/app/services/canvas-manager.service.spec.ts:71:17)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:372:26)\n    at ProxyZoneSpec.onInvoke (node_modules/zone.js/fesm2015/zone-testing.js:287:39)\n    at _ZoneDelegate.invoke (node_modules/zone.js/fesm2015/zone.js:371:52)\n    at Zone.run found\n     * @param gameFeedbackService to enable cheat mode when the user toggles it\n     * ESLint's max-params rule is disabled because the constructor has 5 parameters that are all required for the service to work properly\n     */\n    // The max-params rule is disabled because the class needs all of these services to work properly.\n    // eslint-disable-next-line max-params\n    constructor(\n        private dialog: MatDialog,\n        private saveReplay: SaveReplayService,\n        private gameSocketService: GameSocketService,\n        private gameFeedbackService: GameFeedbackService,\n    ) {\n        // Set the class attributes to their initial value. Default spees is X1.\n        this.isPlaying = false;\n        this.currentTime = 0;\n        this.playbackSpeed = 1;\n        this.playbackSpeedSubject = new Subject<"+"number>();\n        this.counters = new Map<"+"string, CounterService>();\n        this.isThirdHintPaused = false;\n\n        // To allow the game page components to know if the playback is active and display the content accordingly\n        this.isPlaybackActive = false;\n    }\n\n    /**\n     * Allows other classes to access the \"isPlaying\" attribute (used to toggle the play/pause button)\n     *\n     * @returns the value of the \"isPlaying\" attribute\n     */\n    get play(): boolean {\n        return this.isPlaying;\n    }\n\n    /**\n     * Starts the playback of the game by intializing the attributes and starting the interval\n     */\n    startPlayback(): void {\n        if (this.gameFeedbackService.isCheating) this.gameFeedbackService.toggleCheat();\n        this.gameFeedbackService.clearTimeouts();\n        // Notify the front-end that the playback is active to update the display\n        this.isPlaybackActive = true;\n        // Reset the difference counters to 0\n        this.counters.forEach((counter) => {\n            counter.differenceCounter.next(0);\n            counter.count = 0;\n        });\n        if (this.gameSocketService.gameInstance.players.length === 1) {\n            this.gameFeedbackService.nbClues = 3;\n            this.gameFeedbackService.clearClueCanvas();\n        }\n        // Reset the playback speed to its default value\n        this.gameFeedbackService.setFlickerSpeed(1);\n        this.gameSocketService.setErrorDelay(1);\n        this.playbackSpeed = 1;\n        this.playbackSpeedSubject.next(this.playbackSpeed);\n\n        // Wipes the chat messages and the overlayed canvases to start the playback from the beginning\n        this.gameSocketService.startReplay();\n\n        // Create an iterator to iterate through the events in the playback map and find the first event time\n        this.playbackIterator = this.saveReplay.playback.keys();\n        this.nextEventTime = this.playbackIterator.next().value;\n\n        // Start the interval to increment the time and execute the events.\n        // The interval updates every 100ms, which allows for better performance than updating every 1ms but remains mostly accurate to the eye\n        this.playbackInterval = setInterval(this.incrementTime, PlaybackConstants.RefreshSpeed);\n        this.isPlaying = true;\n    }\n\n    /**\n     * Stops the playback of the game by clearing the interval and resetting the attributes\n     * Also opens a dialog to ask the user if they want to replay the game again or exit to the menu\n     *\n     * @param openPopUp true if the method should open the dialog, false otherwise\n     */\n    stopPlayback(openPopUp: boolean): void {\n        // Reset the interval and the currentTime to 0 to allow for a new replay to start\n        this.currentTime = 0;\n        clearInterval(this.playbackInterval);\n        this.isPlaying = false;\n\n        // If the call has been triggered by the restart or quit buttons, we don't want to open the dialog\n        if (!openPopUp) return;\n\n        // Open a dialog to ask the user if they want to replay the game or exit to the menu\n        this.dialog.open(EndReplayComponent, {\n            width: '30%',\n            panelClass: 'container',\n            disableClose: true,\n            autoFocus: false,\n        });\n    }\n\n    /**\n     * Starts playing the game from the point at which the user paused the playback\n     * Called when the user clicks the \"play\" button of the playback toolbar\n     */\n    resumePlayback(): void {\n        if (this.isThirdHintPaused) {\n            this.gameFeedbackService.left.clue.canvas.classList.add('shake');\n            this.gameFeedbackService.right.clue.canvas.classList.add('shake');\n            this.isThirdHintPaused = false;\n        }\n\n        this.playbackInterval = setInterval(this.incrementTime, PlaybackConstants.RefreshSpeed);\n        this.isPlaying = true;\n    }\n\n    /**\n     * Pauses the playback of the game by clearing the interval but keeps the currentTime attribute intact\n     * Called when the user clicks the \"pause\" button of the playback toolbar\n     */\n    pausePlayback(): void {\n        if (\n            this.gameFeedbackService.left.clue.canvas.classList.contains('shake') &&\n            this.gameFeedbackService.right.clue.canvas.classList.contains('shake')\n        ) {\n            this.gameFeedbackService.left.clue.canvas.classList.remove('shake');\n            this.gameFeedbackService.right.clue.canvas.classList.remove('shake');\n            this.isThirdHintPaused = true;\n        }\n\n        clearInterval(this.playbackInterval);\n        this.isPlaying = false;\n    }\n\n    /**\n     * Sets the playback speed to the given value\n     * Called when the user changes the playback speed in the playback toolbar\n     *\n     * @param speed the new playback speed\n     */\n    setPlaybackSpeed(speed: number): void {\n        this.playbackSpeed = speed;\n    }\n\n    /**\n     * Clears the playback map to allow for a new replay to be recorded\n     * Adds a time event at time 0 to the playback map to allow for the next game to start\n     * Called whenever the user exits the game page ; this prevents the user from replaying the game after he has left the page\n     */\n    clearPlayback(): void {\n        this.saveReplay.playback.clear();\n        this.counters.clear();\n        this.saveReplay.playback.set(0, { eventType: 'time', eventData: 0 });\n    }\n\n    /**\n     * Increments the currentTime attribute and executes the events that are due at that time\n     * When the currentTime surpasses the next event time, the event is executed and the next event time is found\n     * When we reach the end of the playback map, the playback is stopped\n     * Called every 100ms by the interval\n     */\n    private incrementTime = () => {\n        // Execute the events that are due at the current time and find the next event time\n        if (this.currentTime >= this.nextEventTime) {\n            this.handleGameEvent(this.saveReplay.playback.get(this.nextEventTime) as { eventType: string; eventData: unknown });\n            this.nextEventTime = this.playbackIterator.next().value;\n        }\n\n        // Stop the playback when we reach the end of the playback map\n        if (!this.nextEventTime) this.stopPlayback(true);\n\n        // Increment the current time by 100 times the playback speed\n        this.currentTime += this.playbackSpeed * PlaybackConstants.RefreshSpeed;\n    };\n\n    /**\n     * Executes the given event by calling the appropriate method in the corresponding service\n     * Called by the incrementTime method\n     *\n     * @param event the event to execute (contains the event type and the event data)\n     * The event data varies from one event to another as not all events require the same information to be properly executed\n     */\n    private handleGameEvent(event: { eventType: string; eventData: unknown }): void {\n        // isReplaying is set to true and passed to the handlers so they know that the event is being executed during a playback\n        // This makes sure that the handlers do not save the data in the playback map again upon a replay\n        const isReplaying = true;\n\n        switch (event.eventType) {\n            case 'serverMessage':\n                this.gameSocketService.handleServerMessage(\n                    (event.eventData as MessageComponent).message.text,\n                    isReplaying,\n                    event.eventData as MessageComponent,\n                );\n                break;\n\n            case 'chatMessageSent':\n                this.gameSocketService.handleChatMessageSent(\n                    (event.eventData as MessageComponent).message.text,\n                    isReplaying,\n                    event.eventData as MessageComponent,\n                );\n                break;\n\n            case 'chatMessageReceived':\n                this.gameSocketService.handleChatMessageReceived(\n                    (event.eventData as MessageComponent).message,\n                    isReplaying,\n                    event.eventData as MessageComponent,\n                );\n                break;\n\n            case 'time':\n                this.gameSocketService.handleGameTimeUpdated(event.eventData as number, isReplaying);\n                break;\n\n            case 'error':\n                this.gameSocketService.handleErrorClick(event.eventData as Pixel, isReplaying);\n                break;\n\n            case 'difference': {\n                const data = event.eventData as { playerName: string; difference: Pixel[] };\n                (this.counters.get(data.playerName) as CounterService).handleWithoutSave(data.difference);\n                break;\n            }\n\n            case 'cheating':\n                this.gameFeedbackService.toggleCheat();\n                break;\n\n            case 'clue':\n                this.gameFeedbackService.useClue(event.eventData as Pixel[]);\n                this.currentTime += this.gameSocketService.gameInstance.hintPenalty * Time.SecToMs;\n                break;\n vate communicationService: CommunicationService, public dialog: MatDialog) {\n        this.currentHistory = [];\n    }\n\n    async getSheets(pageIndex: number) {\n        this.communicationService.getGames(pageIndex).subscribe((pageDetails: PageDetails) => {\n            this.isLastPage = pageDetails.isLastPage;\n            this.pageIndex = pageDetails.pageIndex;\n\n            this.currentGames = [];\n            pageDetails.games.forEach((game: PreviewWithoutImage1) => {\n                this.currentGames.push({ ...game, image1: this.communicationService.getGameFile(game.title, true) });\n            });\n        });\n    }\n\n    async getHistory() {\n        this.communicationService.getHistory().subscribe((history: GameArchive[]) => {\n            this.currentHistory = [];\n            history.forEach((gameHistory: GameArchive) => {\n                this.currentHistory.push(gameHistory);\n            });\n        });\n    }\n\n    async deleteHistory() {\n        if (confirm(\"tes-vous sr de vouloir supprimer l'historique?\")) {\n            this.currentHistory = [];\n            this.communicationService.deleteHistory().subscribe();\n        }\n    }\n\n    nextIndex(): void {\n        this.getSheets(++this.pageIndex);\n    }\n\n    previousIndex(): void {\n        this.getSheets(--this.pageIndex);\n    }\n\n    deleteSheet(title: string): void {\n        if (confirm('tes-vous sr de vouloir supprimer cette feuille?')) {\n            this.currentGames = this.currentGames.filter((game) => game.title !== title);\n            this.communicationService\n                .deleteGame(title)\n                .subscribe()\n                .add(async () => await this.getSheets(this.pageIndex));\n        }\n    }\n\n    deleteAllSheets() {\n        if (confirm('tes-vous sr de vouloir supprimer toutes les fiches?')) {\n            this.currentGames = [];\n            this.communicationService.deleteAllGames().subscribe();\n        }\n    }\n}\n"},"src/app/services/socket
